// import "./App.css";
import React, { useEffect, useState } from "react";

function App() {
    const [data, setData] = useState({});

    useEffect(() => {
        fetch("/api")
            .then((res) => res.json())
            .then((data) => setData(data));
    }, []);

    return <div className="App">123</div>;
}

export default App;
